window.bookSummaryJSON = "<p><i>Necroscope®: The Last of the Lost Years, Volume 1</i>, the 19th in Brian Lumley's Necroscope® series, contains two short novels, one long novella, and one short story. Each of these feature the Necroscope, Harry Keogh, during this final period of his life known as “The Lost Years”. Look for the second volume of The Last of the Lost Years, the 20th in the Necroscope series, which contains two short novels, one long novella, one short story, and a closing piece entitled Resurrection.</p> <p>Stories included in this collection:</p> <ul> <li>In Dublin's Fair City</li> <li>Dinosaur Dreams</li> <li>The Plague-Bearer</li> <li>Harry and the Pirates</li> </ul>"; 
